import * as THREE from 'three';
import * as ARCCUBE from './core.js';

function createDefaultLogoTexture() {
    const image = <HTMLImageElement>document.createElementNS('http://www.w3.org/1999/xhtml', 'img');
    image.src = DefaultLogo;
    const texture = new THREE.Texture(image);
    texture.needsUpdate = true;
    return texture;
}

export function GetSkinByName(name: string): Skin {
    return SkinMap[name];
}

export function GetSkinNameList(): string[] {
    return Object.keys(SkinMap);
}

export type Skin = {
    name: string;
    enableEnvMap: boolean;
    modelFiles: Record<ARCCUBE.CubeType, string>;
    modelLoading: boolean;
    models: Record<string, THREE.Mesh>;
    cube: {
        material: () => THREE.Material;
        activate: (mesh: THREE.Mesh) => void;
        deactivate: (mesh: THREE.Mesh) => void;
    };
    sticker: {
        material: (x: number, y: number, z: number, color: ARCCUBE.StickerColor) => THREE.Material;
        activate: (mesh: THREE.Mesh) => void;
        deactivate: (mesh: THREE.Mesh) => void;
    };
};

const standardSkin: Skin = {
    name: 'Standard',
    enableEnvMap: false,
    modelFiles: {
        axis: 'default-axis',
        center: 'default-center',
        edge: 'default-edge',
        corner: 'default-corner',
        sticker: 'default-sticker',
    },
    modelLoading: false,
    models: {},
    cube: {
        material: () => {
            return new THREE.MeshStandardMaterial({
                color: 0x2f2f2f,
                metalness: 0.8,
                roughness: 0.4,
            });
        },
        activate: (mesh: THREE.Mesh) => {
            const mat = <THREE.MeshStandardMaterial>mesh.material;
            mat.transparent = false;
            mat.opacity = 1.0;
            mat.needsUpdate = true;
        },
        deactivate: (mesh: THREE.Mesh) => {
            const mat = <THREE.MeshStandardMaterial>mesh.material;
            mat.transparent = true;
            mat.opacity = 0.3;
            mat.needsUpdate = true;
        },
    },
    sticker: {
        material: (x: number, y: number, z: number, color: ARCCUBE.StickerColor) => {
            const ColorList = [
                '#ffffff', // U: White
                '#00d800', // F: Green
                '#d80000', // R: Red
                '#ffff00', // D: Yellow
                '#0000d8', // B: Blue
                '#ff8000', // L: Orange
            ];

            const col = ColorList[color];
            let texture = undefined;
            if (x === ARCCUBE.SIDE_MIDDLE && y === ARCCUBE.SIDE_MAX && z === ARCCUBE.SIDE_MIDDLE) {
                // load texture
                // texture = new THREE.TextureLoader().load('./asset/standard/logo.png');
                texture = createDefaultLogoTexture();
                texture.flipY = false;
            }

            const mat = new THREE.MeshStandardMaterial({
                color: col,
                metalness: 0.4,
                roughness: 0.1,
            });
            if (texture != null) {
                mat.map = texture;
                mat.bumpMap = texture;
            }

            return mat;
        },
        activate: (mesh: THREE.Mesh) => {
            const mat = <THREE.MeshStandardMaterial>mesh.material;
            mat.transparent = false;
            mat.opacity = 1.0;
            mat.needsUpdate = true;
        },
        deactivate: (mesh: THREE.Mesh) => {
            const mat = <THREE.MeshStandardMaterial>mesh.material;
            mat.transparent = true;
            mat.opacity = 0.3;
            mat.needsUpdate = true;
        },
    },
};

